function findIntersection(array1, array2) {
    
  // console.log(array1, array2);
  // 遍历第一个数组中的每个元素
  let it;
  array1.forEach(item1 => {
      // 使用 find 方法查找第二个数组中是否存在与当前元素相同的元素
      array2.forEach(item2 => {
          // console.log(item2, item1, item2 === item1);
          // 判断元素是否相同
          if(item2 === item1){
            it = item2;
          }
      });
  });
  return it;
}

function reformatStations(data) {
  const stationMap = {};

  data.forEach(item => {
    // 添加或更新路线映射

    addOrUpdateRoute(stationMap, item["1"], item["2"], item["distance"]);
    addOrUpdateRoute(stationMap, item["2"], item["1"], item["distance"]);
    // console.log(stationMap);
  });

  // console.log(stationMap);
  return stationMap;
  
}

