function addOrUpdateRoute(map, start, end, distance) {
  // if(start == "东管头南") console.log(start, end);
  // 确保map[start]是一个对象而不是数组
  if (!map[start]) {
    map[start] = {
      edge: [],   // 用于存储与其他站点的连接信息
      lines: [],  // 存储当前站点的所有线路
      line_siz: 0 // 线路数量
    };
  }
  
  let existingEntry = map[start].edge.find(entry => entry.station === end);

  if (!existingEntry) {
    const data = fs.readFileSync('C:\\Users\\47987\\Desktop\\Subway\\about_geo\\point.json', 'utf8');
    const geojson = JSON.parse(data);
    let startEntry = geojson.features.find(entry => entry.properties.station_name === start);

    if (startEntry) {
      let lines = startEntry.properties.lines;
      let line_siz = startEntry.properties.line_siz;

      // 更新map[start]的线路信息
      map[start].line_siz = line_siz;
      map[start].lines = lines;

      let endEntry = geojson.features.find(entry => entry.properties.station_name === end);
      let repet = map[start].edge.find(entry => entry.station === end);
      if(repet){
        console.log(repet);
      }

      if (!repet && endEntry) {
        let endLines = endEntry.properties.lines;
        let line = findIntersection(lines, endLines);

        if (line) {
          map[start].edge.push({
            station: end,
            line: line,
            distance: distance
          });
        }
      }else{
        console.log(end);
      }
    }
  }
  
  // 打印当前站点的信息以便调试
  // console.log(start, map[start]);
}


